import React from 'react';
import './App.css';
import Movie from './Movie/Movie';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col, Container, Row } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container className="my-5">
        <Row>
          <Col xs={12} md={6} lg={4} xl={3}>
            <Movie />
          </Col>
          <Col xs={12} md={6} lg={4} xl={3}>
            <Movie />
          </Col>
          <Col xs={12} md={6} lg={4} xl={3}>
            <Movie />
          </Col>
          <Col xs={12} md={6} lg={4} xl={3}>
            <Movie />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
